// client/src/services/auth.js
const authService = {
  register: async (userData) => {
    const res = await axios.post(`${API_URL}/register`, userData);
    if (res.data.token) localStorage.setItem('token', res.data.token);
    return res.data;
  },
  // ... other methods
};

export default authService;
